import React from "react";

const CardOrder = ({ orders }) => {
  return (
    <>
      {orders.map((order) => 
      (
        <div key={order.id} className="col-12 col-sm-4 pt-2">{order.table}</div>
      ))}
    </>
  );
};

export default CardOrder;
